import {
  Box,
  Card,
  CardContent,
  CardHeader,
  Divider,
  Grid,
  Typography,
} from "@material-ui/core";
import React from "react";
import { useParams } from "react-router-dom";
import useData from "../hooks/useData";

const Individual_Bank = () => {
  let { ifsc } = useParams();
  const { data } = useData();
  const rowdata = data.filter((item) => item.ifsc == ifsc)[0];
  return (
    <Box mt={30}>
      <Card style={{ backgroundColor: "#e3dcef" }} variant="outlined">
        <Box ml={2}>
          {" "}
          <Typography variant="h4" color="secondary">
            {" "}
            Bank Information{" "}
          </Typography>
        </Box>

        <Divider></Divider>
        <CardContent>
          <Grid container spacing="2">
            <Grid item xs={6}>
              <Typography variant="h5" color="primary">
                <span style={{ color: "black", fontWeight: "600" }}>
                  Bank Name
                </span>
                : {rowdata?.bank_name}
              </Typography>
            </Grid>
            <Grid item xs={6}>
              <Typography variant="h5" color="primary">
                Bank ID: {rowdata?.bank_id}
              </Typography>
            </Grid>

            <Grid item xs={6}>
              <Typography variant="h5" color="primary">
                Branch Name: {rowdata?.branch}
              </Typography>
            </Grid>

            <Grid item xs={6}>
              <Typography variant="h5" color="primary">
                City: {rowdata?.city}
              </Typography>
            </Grid>
            <Grid item xs={6}>
              <Typography variant="h5" color="primary">
                State: {rowdata?.state}
              </Typography>
            </Grid>
            <Grid item xs={6}>
              <Typography variant="h5" color="primary">
                IFSC CODE: {rowdata?.ifsc}
              </Typography>
            </Grid>
            <Grid item xs={6}>
              <Typography variant="h5" color="primary">
                Address: {rowdata?.address}
              </Typography>
            </Grid>
            <Grid item xs={6}>
              <Typography variant="h5" color="primary">
                District: {rowdata?.district}
              </Typography>
            </Grid>
          </Grid>
        </CardContent>
      </Card>
    </Box>
  );
};

export default Individual_Bank;
